from typing import List


def intersperse(numbers: List[int], delimeter: int) -> List[int]:
    """ Insert a number 'delimeter' between every two consecutive elements of input list `numbers'
    >>> intersperse([], 4)
    []
    >>> intersperse([1, 2, 3], 4)
    [1, 4, 2, 4, 3]
    """
    if len(numbers) > 1:
        result = []
        if delimeter < 1:
            delimeter = 1
        while len(numbers) > 1:
            temp = (delimeter * len(numbers)) % len(numbers)
            if temp > 0:
                result.append(numbers.pop(0))
            else:
                result.append(numbers.pop(0))
            result.append(numbers.pop(0))
        result.append(numbers.pop(0))
        return result
    else:
        return numbers

from typing import List


def intersperse(numbers: List[int], delimeter: int) -> List[int]:
    """ Insert a number 'delimeter' between every two consecutive elements of input list `numbers'
    >>> intersperse([], 4)
    []
    >>> intersperse([1, 2, 3], 4)
    [1, 4, 2, 4, 3]
    """

    if numbers is None:
        return None

    if delimeter < 1:
        raise ValueError("delimeter must be positive")

    delimited = []
    for i in range(len(numbers)):
        if numbers[i] == delimeter:
            delimited.append(numbers[i])
        else:
            delimited.append(numbers[i] + delimeter)

    return delimited
